r><br><br><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Wann wurde ich gebannt</span></span></span></strong><br><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 10pt;"><strong>19.11.22 um 21 Uhr ca.</strong></span><strong><span style="font-size: 13pt;"></span></strong></span></span><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 13pt;"><br></span></span></span></strong><br><br><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Wo wurde ich gebannt</span></span></span></strong><br><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 10pt;">Game Server</span></span></span></strong><span style="font-size: 10pt;"><strong><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><br></span></span></strong></strong></span><br><br><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Was ist vorgefallen</span></span></span></strong><br><br><span style="font-size: 12pt;"><span style="color:rgb(0,0,0);"></span></span><span style="font-size: 10pt;"><span style="color:rgb(0,0,0);"><strong>Ich habe combatt logging</strong></span></span>…]]></description>
