						<content:encoded><![CDATA[<p class="text-center"><strong><span style="color:rgb(255,0,0);"><span style="font-family:Arial;"><span style="font-size: 23pt;"><img src="https://lh5.googleusercontent.com/qOUuvDg3WHR7Equ5dCX2TM7Nf0UXzzsVZj7tnzgxeNcHlVp3DbOjyEhDPKA0FCrXzqCIH01K2dQXc389dQQGH_cd_jzkpH3AaRDH4CmhbnMO_IoCViga_tzZOMH6or_Wi-YGdt_S=s0" alt="qOUuvDg3WHR7Equ5dCX2TM7Nf0UXzzsVZj7tnzgxeNcHlVp3DbOjyEhDPKA0FCrXzqCIH01K2dQXc389dQQGH_cd_jzkpH3AaRDH4CmhbnMO_IoCViga_tzZOMH6or_Wi-YGdt_S=s0" width="215" height="68" class="jsResizeImage"></span></span></span></strong></p><p class="text-center"><strong><span style="color:rgb(255,0,0);"><span style="font-family:Oswald, sans-serif;"><span style="font-size: 23pt;">ENTBANNUNGSANTRAG</span></span></span></strong></p><p class="text-center"><br></p><p class="text-center"><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Steam Name</span></span></span></strong></p><p class="text-center"><strong><span style="color:rgb(0,0,0);">HoodBlaqNN7<br></span></strong></p><p class="text-center"><br></p><p class="text-center"><br></p><p class="text-center"><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Länge des Bans</span></span></span></strong></p><p class="text-center"><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 10pt;">7 Tage (noch 1 Tag 7 Stunden)</span><span style="font-size: 13pt;"><br></span></span></span></strong></p><p class="text-center"><br></p><p class="text-center"><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Ban Grund</span></span></span></strong></p><p class="text-center"><strong><span style="color:rgb(0,0,0);">combatt logging</span><strong><span style="color:rgb(0,0,0);"><br></span></strong></strong></p><p class="text-center"><br></p><p class="text-center"><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Gebannt von</span></span></span></strong></p><p class="text-center"><span style="color:rgb(0,0,0);"><span style="font-size: 10pt;"><strong>[DLRP] Felix</strong></span></span><strong><span style="color:rgb(0,0,0);"><span style="font-size: 10pt;"><br></span></span></strong><span style="font-size: 10pt;"> </span></p><p class="text-center"><br></p><p class="text-center"><br></p><p class="text-center"><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Wann wurde ich gebannt</span></span></span></strong></p><p class="text-center"><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 10pt;"><strong>19.11.22 um 21 Uhr ca.</strong></span><strong><span style="font-size: 13pt;"></span></strong></span></span><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 13pt;"><br></span></span></span></strong></p><p class="text-center"><br></p><p class="text-center"><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Wo wurde ich gebannt</span></span></span></strong></p><p class="text-center"><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 10pt;">Game Server</span></span></span></strong><span style="font-size: 10pt;"><strong><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><br></span></span></strong></strong></span></p><p><br></p><p class="text-center"><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Was ist vorgefallen</span></span></span></strong></p><p><br></p><p class="text-center"><span style="font-size: 12pt;"><span style="color:rgb(0,0,0);"></span></span><span style="font-size: 10pt;"><span style="color:rgb(0,0,0);"><strong>Ich habe combatt logging gemacht da ich etwas sauer war weil die Gegenpartei nur auf Gambo auf war und ich dummer Weise mein PC einfach ausgeschaltet hatte. Es tut mir wirklich leid... Ich habe dieses dumme Fehlverhalten eingesehen und verspreche so ein dummen Scheiß nie wieder zu machen um geilere RP Situationen zu haben.</strong><strong><br></strong></span></span><span style="font-size: 12pt;"><span style="color:rgb(0,0,0);"></span></span></p><p class="text-center"></p><p><span style="font-size: 12pt;"><span style="color:rgb(0,0,0);"><strong><br></strong></span></span></p><p class="text-center"><strong><span style="font-family:Arial;"><span style="font-size: 12pt;"><span style="color:rgb(0,0,0);"><span></span></span></span></span></strong></p><p class="text-center"><br></p><p class="text-center"><strong><span style="color:rgb(0,255,0);"><span style="font-family:Arial;"><span style="font-size: 16pt;">Schlusssatz</span></span></span></strong></p><p class="text-center"><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 13pt;">Vielen Dank für da</span></span></span></strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 13pt;">s</span></span></span><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 13pt;"> Durchlesen meines Entbannungsantrages.</span></span></span></strong></p><p class="text-center"><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 13pt;">Ich würde mich sehr freuen, wenn ihr mich Entbannen würdet.</span></span></span></strong></p><p class="text-center"><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 13pt;"><span></span></span></span></span></strong></p><p class="text-center"><br></p><p class="text-center"><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><strong><span style="font-size: 18pt;">Sorry Felix und die Comunity </span></strong></span></span></p><p class="text-center"><br></p><p class="text-center"><strong><span style="color:rgb(255,0,0);"><span style="font-family:Oswald, sans-serif;"><span style="font-size: 23pt;">Mit freundlichen Grüßen,</span></span></span></strong></p><p class="text-center"><span style="color:rgb(128,0,0);"><strong><span style="font-family:'Comic Sans MS', 'Marker Felt', cursive;">Manjeet<br></span></strong></span></p>]]></content:encoded>
