			<title><![CDATA[Entbannungsantrag an das Dlrp Team @Timo]]></title>
			<link><![CDATA[https://forum.dlrp.eu/forum/index.php?thread/11879-entbannungsantrag-an-das-dlrp-team-timo/]]></link>
			<description><![CDATA[Hallo Liebes Dlrp Team,<br><br>1. Wo wurdest du gebannt?<br>Ich wurde auf dem Discord und auf dem Server Permanent gebannt.<br><br>2. Wann wurdest du Gebannt?<br>Vor ca. 1-2 Wochen.<br><br>3. Wer hat dich gebannt?<br>Timo<br><br>4. Für wie lange wurdest gebannt?<br>Ich wurde Permanent ausgeschlossen<br><br>5.…]]></description>
			<pubDate>Sun, 20 Nov 2022 11:02:15 +0000</pubDate>
			<dc:creator><![CDATA[Hardy Kaliber]]></dc:creator>
			<guid><![CDATA[https://forum.dlrp.eu/forum/index.php?thread/11879-entbannungsantrag-an-das-dlrp-team-timo/]]></guid>
						<content:encoded><![CDATA[<p>Hallo Liebes Dlrp Team,</p><p><br></p><p>1. Wo wurdest du gebannt?</p><p>Ich wurde auf dem Discord und auf dem Server Permanent gebannt.</p><p><br></p><p>2. Wann wurdest du Gebannt?</p><p>Vor ca. 1-2 Wochen.</p><p><br></p><p>3. Wer hat dich gebannt?</p><p>Timo</p><p><br></p><p>4. Für wie lange wurdest gebannt?</p><p>Ich wurde Permanent ausgeschlossen</p><p><br></p><p>5. Mit welchem Grund wurdest du gebannt?</p><p>Machs gut, brauchst keinen Antrag stellen.</p><p><br></p><p>6 . Was ist vorgefallen?</p><p>Ich habe ihm im rp gepittet und darauf hin hat er mich permanent gebannt, was ich für sehr traurig halte.</p><p><br></p><p>7. Warum willst du entbannt werden?</p><p>Ich würde gerne entbannt werden , da ich das für einen sehr hetzenden Bann halte und ich echt gerne auf dlrp gespielt habe. Ich hatte eigentlich nie problem mit dem Team aber anscheinend hat ja Timo ein Problem mit mir .</p><p><br></p><p>8. Gebe deinen Steamnamen an:</p><p>Steam: Hardy</p><p>Discord: Hardy#8085</p>]]></content:encoded>
						<slash:comments><![CDATA[0]]></slash:comments>
		</item>
