			<description><![CDATA[<span style="color:rgb(220,221,222);"><span style="font-family:Whitney, 'Helvetica Neue', Helvetica, Arial, sans-serif;"><span style="font-size: 16px;">Hallo Liebes darklife Team. Das ist mein Enntbanungsantrag.<br>Wann wurdest du Gebannt? : 11.11.2022<br>Wer hat dich gebannt? : Timo<br>Für wie lange wurde ich gebannt? : Permanent<br>Mit welchem Grund wurde ich gebannt? : Massen rdm<br>Was ist vorgefallen? : Ich habe von</span></span></span>…]]></description>
