						<content:encoded><![CDATA[<p><span style="color:rgb(220,221,222);"><span style="font-family:Whitney, 'Helvetica Neue', Helvetica, Arial, sans-serif;"><span style="font-size: 16px;">Hallo Liebes darklife Team. Das ist mein Enntbanungsantrag.<br>Wann wurdest du Gebannt? : 11.11.2022<br>Wer hat dich gebannt? : Timo<br>Für wie lange wurde ich gebannt? : Permanent<br>Mit welchem Grund wurde ich gebannt? : Massen rdm<br>Was ist vorgefallen? : Ich habe von jemanden das moped geklaut und die wollten mich dan töten und dann habe ich sie mit einer lang waffe getötet.Außerdem habe ich einen modder getötet<br>Warum will ich entbannt werden? : Ich würde gerne Entbannt werden weil ich vor dem bann sehr viel spaß auf dem Server hatte und ich schon sehr lange auf dem server gespielt habe.<br>Ich heiße auf Steam: xRayz<br>ich entschuldige mich und würde mich über eine Entbannung sehr freuen.</span></span></span></p>]]></content:encoded>
